import React from 'react';
import Card from './Card';
import { PropTypes } from 'prop-types';


const CardList = (props) => {

    const BuildSrc = (number) => { return "/images/" + number + ".jpg" } 
    const BuildGraySrc = (number) => {return "/images/" + number + "_gray.jpg" }
    
    return (

        <div className="game-field">             
            <div className="row">                
                <Card 
                    buildImageUrl={BuildSrc(props.cardNumbers[0])} 
                    buildGrayImageUrl={BuildGraySrc(props.cardNumbers[0])}
                    number={props.cardNumbers[0]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />    
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[1])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[1])}
                    number={props.cardNumbers[1]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />    
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[2])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[2])}
                    number={props.cardNumbers[2]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />   
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[3])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[3])}
                    number={props.cardNumbers[3]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />                                                     
            </div>
            <div className="row">                
            <Card 
                    imageUrl={BuildSrc(props.cardNumbers[4])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[4])}
                    number={props.cardNumbers[4]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />    
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[5])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[5])}
                    number={props.cardNumbers[5]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />    
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[6])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[6])}
                    number={props.cardNumbers[6]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />   
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[7])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[7])}
                    number={props.cardNumbers[7]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />   
            </div>
            <div className="row">                
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[8])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[8])}
                    number={props.cardNumbers[8]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />    
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[9])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[9])}
                    number={props.cardNumbers[9]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />    
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[10])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[10])}
                    number={props.cardNumbers[10]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />   
                <Card 
                    imageUrl={BuildSrc(props.cardNumbers[11])} 
                    grayImageUrl={BuildGraySrc(props.cardNumbers[11])}
                    number={props.cardNumbers[11]} 
                    onReveal={props.addToSelecteds} 
                    onHide={props.removeFromSelecteds} 
                    canHide={props.canHide}   
                    OnCheckAvailables={props.OnCheckAvailables}                  
                    />   
            </div> 
        </div>
        );
}

CardList.propTypes  = {    
    cardNumbers: PropTypes.array,
    addToSelecteds: PropTypes.func,
    removeFromSelecteds: PropTypes.func,
    canHide: PropTypes.func,
    OnCheckAvailables: PropTypes.func,
}

export default CardList;
